const initState = {
    snapshots: [
        {id: '1', title: 'Title1', conclusion: 'Conclusion1', image: "data:image/jpeg;base64,",
        mask: " data:image/png;base64,"},
        {id: '2', title: 'Title2', conclusion: 'Conclusion2', image: " data:image/jpeg;base64,",
        mask: " data:image/png;base64,"},
        {id: '3', title: 'Title3', conclusion: 'Conclusion3', image: " data:image/jpeg;base64,",
        mask: " data:image/png;base64,"}
    ]
}

const snapshotReducer = (state = initState, action) => {
    switch (action.type) {
        case 'CREATE_SNAPSHOT':
            console.log('created snapshot', action.snapshot);
            return state;
        case 'CREATE_SNAPSHOT_ERROR':
            console.log('create snapshot error', action.err);
            return state;
        default:
            return state;
    }
}

export default snapshotReducer